import react from 'react';
import MainPage from './baseTheme/MainPage';
import './App.css';

function App() {
    return (
        <div className="app-container">
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li>
                                <Link to="/">Home</Link>
                            </li>
                        </ul>
                    </nav>
                    <Switch>
                        <Route path="/home">
                            <MainPage />
                        </Route>
                    </Switch>
                </div>
            </Router>
        </div>
    );
}

export default App;
